import React, { Component } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import { toast } from "react-toastify";

import "../../../../css/dashboard.css";
import { authDetail } from "../../../common/config";
import profileIcon from "../../../../Images/user.png";

const initialState = {
  user: [],
};

class AddResearchPapaer extends Component {
  constructor(props) {
    super(props);
  }

  // state = {};

  componentDidMount() {
    let user = {};
    axios
      .get("http://localhost:8000/users/get-user-details", {
        headers: {
          Authorization: localStorage.getItem("token"),
        },
      })
      .then((res) => {
        user: res.data.data;
      })
      .catch((err) => {
        console.log(err);
      });
    return user;
  }

  render() {
    return (
      <div id="wrapper">
        <aside id="sidebar-wrapper">
          <div className="sidebar-brand">
            <h2></h2>
          </div>
          <ul className="sidebar-nav">
            <li className="active">
              <a href="/research-dash">
                <i className="fa fa-plus"></i>Reseach Papers
              </a>
            </li>
            <li>
              <a href="/research-dash-details">
                <i className="fa fa-home"></i>Home
              </a>
            </li>
            <li>
              <a href="/research-dash-profile">
                <i className="fa fa-user"></i>Profile
              </a>
            </li>
          </ul>
        </aside>

        <div id="navbar-wrapper">
          <nav className="navbar navbar-inverse">
            <div className="container-fluid">
              <div className="navbar-header">
                {/* <a href="#" className="navbar-brand" id="sidebar-toggle">
                <i className="fa fa-bars"></i>
              </a> */}
                <div>
                  <img className="profile-img" src={profileIcon} alt="" />
                </div>
              </div>
            </div>
          </nav>
        </div>

        <section id="content-wrapper">
          <div className="row">
            <div className="col-lg-12">
              <h2 className="content-title">/research-dash-paper</h2>
              <p>Lorem ipsum...</p>
            </div>
          </div>
        </section>
      </div>
    );
  }
}

export default AddResearchPapaer;
